import React,{useState} from 'react'


function App() {
const[count,setcount]=useState(0);
  return (
    <div className="App">
      <center></center>
      <h1>Samplecalc</h1>
      <h1>{count}</h1>
      <button onClick={()=> setcount(count+1)}>Increment</button>
      <button onClick={()=> setcount(count-1)}>Decrement</button>
      <button onClick={()=> setcount("")}>Reset</button>

    </div>
  );
}

export default App;
